MIDLAND COGENERATION VENTURE LIMITED PARTNERSHIP MARKET RATE TARIFF
1. Availability. Midland Cogeneration Ventures Limited Partnership ("Seller") makes available under this Tariff the following services to customers with whom Seller contracts: (a) electric energy and capacity for wholesale sales; and (b) ancillary services, as described in Section 5 below. 2. Applicability. This Tariff is applicable to all wholesale power sales, including energy and capacity sales not otherwise subject to a particular rate schedule of Seller, to applicable ancillary services. 3. Rates. All sales shall be made at rates established by agreement between the purchaser and Seller. 4. Other Terms and Conditions. All other terms and conditions shall be established by agreement between the purchaser and Seller. 5. Ancillary Services. Seller also will make available to any purchaser with whom it has contracted, the ancillary services listed in this Paragraph 5. (a) PJM: Seller offers regulation and frequency response service, energy imbalance service, and operating reserve service (which includes spinning reserves, 10- minute, and 30-minute reserves) for sale into the market administered by PJM Interconnection, L.L.C. ("PJM") and, where the PJM Open Access Transmission Tariff permits, the self-supply of these services to purchasers for a bilateral sale that is used to satisfy the ancillary services requirements of the PJM Office of Interconnection. (b) New York: Seller offers regulation and frequency response service, and operating reserve service (which include 10-minute non-synchronous, 30-minute operating reserves, 10-minute spinning reserves, and 10-minute non-spinning reserves) for sale to purchasers in the market administered by the New York Independent System Operator, Inc. (c) New England: Seller offers regulation and frequency response service (automatic generator control), operating reserve service (which includes 10-minute spinning reserve, 10-minute non-spinning reserve, and 30-minute operating reserve service) to purchasers within the markets administered by the ISO New England, Inc. (d) California: Seller offers regulation service, spinning reserve service, and non-spinning reserve service to the California Independent System Operator ("CAISO") and to others that are self-supplying ancillary services to the CAISO. (e) Midwest ISO: Seller offers regulation service and operating reserve service (which include 10-minute spinning reserve and 10-minute supplemental reserve) for sale to the Midwest Independent Transmission System Operator, Inc. (Midwest ISO) and to others that are self-supplying ancillary services to Midwest ISO. (f) Third-Party Ancillary Services: Seller offers: Regulation Service, Energy Imbalance Service, Spinning Reserves, and Supplemental Reserves. Sales will not include the following: (1) sales to an RTO or an ISO, i.e., where that entity has no ability to self-supply ancillary services but instead depends on third parties; (2) sales to a traditional, franchised public utility affiliated with the third-party supplier, or sales where the underlying transmission service is on the system of the public utility affiliated with the third-party supplier; and (3) sales to a public utility that is purchasing ancillary services to satisfy its own open access transmission tariff requirements to offer ancillary services to its own customers. 6. Compliance with Commission Regulations: Seller shall comply with the provisions of 18 CFR Part 35, Subpart H, as applicable, and with any conditions the Commission imposes in its orders concerning Seller's market-based rate authority, including orders in which the Commission authorizes seller to engage in affiliate sales under this Tariff or otherwise restricts or limits the Seller's market-based rate authority. Failure to comply with the applicable provisions of 18 CFR Part 35, Subpart H, and with any orders of the Commission concerning Seller's market-based rate authority, will constitute a violation of this Tariff. 7. 7. Limitations and Exemptions Regarding Market-Based Rate Authority. Seller has requested and has been granted the following waivers of Commission regulations, pursuant to Commission order, Midland Cogeneration Venture Limited Partnership, 116 FERC 61,011, at PP 17, 22 (2006): (a) waiver of the filing requirements of subparts B and C of Part 35 of the Commission's regulations, except as to Sections 35.12(a), 35.13(b), 35.15, and 35.16, to the extent necessary, consist with the Commission's regulations;
(b) waiver of the accounting, reporting and other requirements of Parts 41 (accounts, records, and memoranda), 101 (uniform system of accounts), and 141 (statements and reports) of the Commission's regulations, except Section 141.14 and 141.15;
(c) blanket authorization for the issuance of securities or the assumption of liabilities pursuant to Section 204 of the FPA and Part 34 of the Commission's regulations; and
(d) waiver of the affiliate restrictions under Section 35.39 of the Commission's regulations.
8. Seller Category: Seller is a Category 2 seller, as defined in 18 CFR 35.36(a)(3), in the Central region. Seller is a Category 1 seller, as defined in 18 CFR 35.36(a)(2), in all other regions. 9. Communications. Except as otherwise agreed in writing by the purchaser and Seller, any notice, demand or request provided for in this Tariff shall be deemed to be properly given or made if set forth in writing and delivered or sent by first-class mail, postage prepaid, to Seller at its principal office or to any purchaser when sales are made to wholesale purchasers under this Tariff. 10. Duration. This Tariff shall continue in effect until terminated or changed and such termination or change becomes effective in accordance with any applicable regulatory requirements. 11. Modification. Seller may unilaterally apply to the Commission or successor agency at any time for authority to change the terms or conditions of this Tariff under Section 205 of the Federal Power Act and the regulations promulgated there under. 12. Effective Date. This Tariff is effective upon the date authorized by the Commission.
